// PumpDetail.js
import React from 'react';
import { useParams } from 'react-router-dom';

const PumpDetail = () => {
    const { id } = useParams(); // Get the pump ID from the URL

    // Here you would typically fetch the pump details based on the ID
    // For demonstration, we're using a static message
    return (
        <div>
            <h1>Pump Detail for {id}</h1>
            <p>Details about the pump will go here.</p>
            {/* You can add more detailed information about the pump */}
        </div>
    );
};

export default PumpDetail;
